import React from 'react';
import './App.css';
import Category from './components/Category/Category.jsx';

const categories = ["ola", "teste", "teste"];

function App() {

  return (
    <>
      {categories.map(c => (
        <Category name={c}></Category>
      ))}
    </>
  );
}

export default App;
